from collections import defaultdict
from itertools import combinations


class Solution:
    def rabinKarp(self, s, sub_len):
        if sub_len == 0:
            return ''
        h = 1
        t = 0
        d = 256
        q = (1 << 31) - 1
        dic = defaultdict(list)
        for i in range(sub_len - 1):
            h = (h * d) % q
        for i in range(sub_len):
            t = (d * t + ord(s[i])) % q
        dic[t].append(0)  # record the start index of sub_string
        for i in range(len(s) - sub_len):  # remove current char and add one char
            t = (d * (t - ord(s[i]) * h) + ord(s[i + sub_len])) % q
            for idx in dic[t]:
                if s[idx:idx+sub_len] == s[i+1:i+1+sub_len]:
                    return s[idx:idx+sub_len]
            dic[t].append(i + 1)
        # for key in dic:
        #     for i, j in combinations(dic[key], 2):
        #         if s[i:i + sub_len] == s[j:j + sub_len]:
        #             return s[i:i + sub_len]
        return ''

    def longestDupSubstring(self, S: str) -> str:
        left = 0
        right = len(S) - 1
        substring = ''
        while left <= right:
            mid = (left + right) // 2
            found_substring = self.rabinKarp(S, mid)
            if found_substring or mid == 0:
                substring = found_substring
                left = mid + 1
            else:
                right = mid - 1
        return substring


if __name__ == '__main__':
    s = Solution()
    print(s.longestDupSubstring('banana'))
    print(s.longestDupSubstring('abcd'))
    print(s.longestDupSubstring('abca'))
    print(s.longestDupSubstring('a' * 100000))
    print(s.longestDupSubstring(
        ""))
    print(s.longestDupSubstring(
        ""))
